// 模糊匹配算法
const inputCarName = $('准备查询').item.json.carName;
const allCars = $input.all();

const MATCH_THRESHOLD = 0.70;

console.log(`\n===== 开始模糊匹配 =====`);
console.log(`输入车型: ${inputCarName}`);
console.log(`数据库总数: ${allCars.length}`);

// 字符串相似度算法
function levenshteinDistance(str1, str2) {
  const len1 = str1.length;
  const len2 = str2.length;
  const matrix = [];

  for (let i = 0; i <= len1; i++) {
    matrix[i] = [i];
  }
  for (let j = 0; j <= len2; j++) {
    matrix[0][j] = j;
  }

  for (let i = 1; i <= len1; i++) {
    for (let j = 1; j <= len2; j++) {
      const cost = str1[i - 1] === str2[j - 1] ? 0 : 1;
      matrix[i][j] = Math.min(
        matrix[i - 1][j] + 1,
        matrix[i][j - 1] + 1,
        matrix[i - 1][j - 1] + cost
      );
    }
  }

  return matrix[len1][len2];
}

function levenshteinSimilarity(str1, str2) {
  const maxLen = Math.max(str1.length, str2.length);
  if (maxLen === 0) return 1.0;
  const distance = levenshteinDistance(str1, str2);
  return 1 - distance / maxLen;
}

function jaroWinklerSimilarity(s1, s2) {
  function jaroSimilarity(s1, s2) {
    if (s1.length === 0 && s2.length === 0) return 1.0;
    if (s1.length === 0 || s2.length === 0) return 0.0;

    const matchDistance = Math.floor(Math.max(s1.length, s2.length) / 2) - 1;
    const s1Matches = new Array(s1.length).fill(false);
    const s2Matches = new Array(s2.length).fill(false);

    let matches = 0;
    let transpositions = 0;

    for (let i = 0; i < s1.length; i++) {
      const start = Math.max(0, i - matchDistance);
      const end = Math.min(i + matchDistance + 1, s2.length);

      for (let j = start; j < end; j++) {
        if (s2Matches[j] || s1[i] !== s2[j]) continue;
        s1Matches[i] = true;
        s2Matches[j] = true;
        matches++;
        break;
      }
    }

    if (matches === 0) return 0.0;

    let k = 0;
    for (let i = 0; i < s1.length; i++) {
      if (!s1Matches[i]) continue;
      while (!s2Matches[k]) k++;
      if (s1[i] !== s2[k]) transpositions++;
      k++;
    }

    return (
      (matches / s1.length +
        matches / s2.length +
        (matches - transpositions / 2) / matches) /
      3
    );
  }

  const jaro = jaroSimilarity(s1, s2);
  const prefixLength = Math.min(4, s1.length, s2.length);
  let prefix = 0;
  for (let i = 0; i < prefixLength; i++) {
    if (s1[i] === s2[i]) prefix++;
    else break;
  }

  return jaro + prefix * 0.1 * (1 - jaro);
}

function containsMatch(input, target) {
  const inputLower = input.toLowerCase();
  const targetLower = target.toLowerCase();

  if (targetLower.includes(inputLower) || inputLower.includes(targetLower)) {
    return 1.0;
  }

  const inputTokens = inputLower.split(/[\s\-]+/);
  const targetTokens = targetLower.split(/[\s\-]+/);

  let matchCount = 0;
  for (const inputToken of inputTokens) {
    if (inputToken.length < 2) continue;
    for (const targetToken of targetTokens) {
      if (targetToken.includes(inputToken) || inputToken.includes(targetToken)) {
        matchCount++;
        break;
      }
    }
  }

  return inputTokens.length > 0 ? matchCount / inputTokens.length : 0;
}

function brandModelMatch(input, target) {
  const inputParts = input.split(/[-\s]+/);
  const targetParts = target.split(/[-\s]+/);

  if (inputParts.length < 2 || targetParts.length < 2) {
    return 0;
  }

  const brandMatch = inputParts[0].toLowerCase() === targetParts[0].toLowerCase() ? 1 : 0;
  const modelSimilarity = levenshteinSimilarity(
    inputParts.slice(1).join('').toLowerCase(),
    targetParts.slice(1).join('').toLowerCase()
  );

  return brandMatch && modelSimilarity >= 0.6 ? (brandMatch + modelSimilarity) / 2 : 0;
}

function calculateComprehensiveScore(input, target) {
  const inputNorm = input.replace(/\s+/g, '').toLowerCase();
  const targetNorm = target.replace(/\s+/g, '').toLowerCase();

  const inputClean = input.replace(/[\s\-]/g, '').toLowerCase();
  const targetClean = target.replace(/[\s\-]/g, '').toLowerCase();
  const isFullyContained = targetClean.includes(inputClean) && inputClean.length >= 3;

  const levenScore = levenshteinSimilarity(inputNorm, targetNorm);
  const jaroScore = jaroWinklerSimilarity(inputNorm, targetNorm);
  const containsScore = containsMatch(input, target);
  const brandModelScore = brandModelMatch(input, target);

  const weights = {
    levenshtein: 0.25,
    jaroWinkler: 0.25,
    contains: 0.30,
    brandModel: 0.20
  };

  let finalScore = 
    levenScore * weights.levenshtein +
    jaroScore * weights.jaroWinkler +
    containsScore * weights.contains +
    brandModelScore * weights.brandModel;

  if (isFullyContained) {
    finalScore = Math.max(finalScore, 0.88);
  }

  return {
    finalScore: finalScore,
    details: {
      levenshtein: levenScore.toFixed(3),
      jaroWinkler: jaroScore.toFixed(3),
      contains: containsScore.toFixed(3),
      brandModel: brandModelScore.toFixed(3)
    }
  };
}

const matches = [];

for (const car of allCars) {
  const carName = car.json.carName || '';
  const carID = car.json.carID;
  const brandID = car.json.brandID;

  if (!carName || !carID) continue;

  const scoreResult = calculateComprehensiveScore(inputCarName, carName);

  matches.push({
    carName: carName,
    carID: carID,
    brandID: brandID,
    vehicleClass: car.json.vehicleClass,
    priceRange: car.json.carPriceRange,
    score: scoreResult.finalScore,
    scoreDetails: scoreResult.details
  });
}

matches.sort((a, b) => b.score - a.score);

console.log(`\n前5个匹配结果:`);
matches.slice(0, 5).forEach((match, index) => {
  console.log(`${index + 1}. ${match.carName} - 相似度: ${(match.score * 100).toFixed(1)}%`);
});

const bestMatch = matches[0];

if (bestMatch && bestMatch.score >= MATCH_THRESHOLD) {
  console.log(`\n✅ 匹配成功！`);
  console.log(`输入: ${inputCarName}`);
  console.log(`匹配: ${bestMatch.carName}`);
  console.log(`相似度: ${(bestMatch.score * 100).toFixed(1)}%`);
  console.log(`carID: ${bestMatch.carID}`);

  return {
    json: {
      needsSearch: false,
      resolved: true,
      carId: bestMatch.carID,
      carName: bestMatch.carName,
      brandID: bestMatch.brandID,
      matchType: 'googlesheet_fuzzy_match',
      similarityScore: bestMatch.score,
      inputCarName: inputCarName
    }
  };
}

console.log(`\n⚠️ 未找到满足阈值的匹配，降级到SerpAPI搜索`);

return {
  json: {
    needsSearch: true,
    carName: inputCarName,
    matchType: 'low_similarity',
    bestMatchScore: bestMatch?.score || 0
  }
};

const carName = $('检查是否需要搜索').first().json.carName;
const response = $input.item.json;

console.log('===== SerpAPI响应 =====');
console.log('车型名称:', carName);

const organicResults = response.organic_results || [];
console.log('找到', organicResults.length, '个搜索结果');

let carId = null;

for (const result of organicResults) {
  const link = result.link || '';
  console.log('检查链接:', link);

  const patterns = [
    /autohome\.com\.cn\/(\d{2,5})\/?/,
    /series-(\d{2,5})\.html/,
    /config\/series\/(\d{2,5})/
  ];

  for (const pattern of patterns) {
    const match = link.match(pattern);
    if (match && match[1]) {
      carId = match[1];
      console.log('✅ 找到carId:', carId);
      break;
    }
  }

  if (carId) break;
}

if (carId && /^\d{2,5}$/.test(carId)) {
  console.log('✅ 成功提取carId:', carId);
  return {
    json: {
      carId: carId,
      carName: carName,
      matchType: 'serpapi_search',
      resolved: true
    }
  };
}

console.log('❌ 未能从搜索结果中提取carId');
return {
  json: {
    success: false,
    error: '未能从搜索结果中提取carId',
    code: 'EXTRACTION_FAILED',
    carName: carName
  }
};

// 提取外观、内饰、座椅图片
const inputData = $input.first().json;

// 从上游节点获取车型信息
const carInfo = {
  carId: $('合并carID结果').item.json.carId,
  carName: $('合并carID结果').item.json.carName,
  brandID: $('合并carID结果').item.json.brandID,
  matchType: $('合并carID结果').item.json.matchType
};

console.log('处理车型:', carInfo.carName, '(ID:', carInfo.carId, ')');

let htmlContent = '';
if (inputData.data) {
  htmlContent = inputData.data;
} else if (typeof inputData === 'string') {
  htmlContent = inputData;
} else {
  console.log('无法找到HTML内容');
  return [{ json: { ...carInfo, error: '数据格式错误' } }];
}

console.log('HTML长度:', htmlContent.length);

const scriptMatch = htmlContent.match(/<script id="__NEXT_DATA__"[^>]*>(.*?)<\/script>/);

if (!scriptMatch) {
  console.log('未找到__NEXT_DATA__标签');
  return [{ json: { ...carInfo, error: '未找到JSON数据' } }];
}

try {
  const jsonData = JSON.parse(scriptMatch[1]);
  console.log('成功解析JSON数据');

  const picinfo = jsonData.props?.pageProps?.SeriesPicList?.picinfo;

  if (!picinfo || !picinfo.callist) {
    console.log('未找到图片分类列表');
    return [{ json: { ...carInfo, error: '未找到图片分类' } }];
  }

  console.log('找到图片分类列表，数量:', picinfo.callist.length);

  const imageList = [];

  // 提取外观图片 (前4张)
  const waiGuanClass = picinfo.callist.find(item => item.name === '外观');

  if (waiGuanClass && waiGuanClass.list && waiGuanClass.list.length > 0) {
    console.log('外观图片总数:', waiGuanClass.list.length);

    const waiGuanViewTypes = ['view45', 'viewFront', 'view-45', 'viewSide'];
    const waiGuanCount = Math.min(4, waiGuanClass.list.length);

    for (let i = 0; i < waiGuanCount; i++) {
      const pic = waiGuanClass.list[i];

      imageList.push({
        ...carInfo,
        image_url: pic.picpath,
        image_index: i + 1,
        category: '外观',
        view_type: waiGuanViewTypes[i],
        pic_id: pic.picid,
        spec_id: pic.specid
      });

      console.log(`外观图片 ${i + 1} [${waiGuanViewTypes[i]}]: ${pic.picpath}`);
    }
  }

  // 提取内饰图片 (第1张和第6张)
  const neiShiClass = picinfo.callist.find(item => item.name === '内饰');

  if (neiShiClass && neiShiClass.list && neiShiClass.list.length > 0) {
    console.log('内饰图片总数:', neiShiClass.list.length);

    const neiShiIndexes = [0, 5];
    const neiShiViewTypes = ['viewCNSL', 'viewIP'];

    for (let i = 0; i < neiShiIndexes.length; i++) {
      const index = neiShiIndexes[i];

      if (index < neiShiClass.list.length) {
        const pic = neiShiClass.list[index];

        imageList.push({
          ...carInfo,
          image_url: pic.picpath,
          image_index: 4 + i + 1,
          category: '内饰',
          view_type: neiShiViewTypes[i],
          pic_id: pic.picid,
          spec_id: pic.specid
        });

        console.log(`内饰图片 ${index + 1} [${neiShiViewTypes[i]}]: ${pic.picpath}`);
      }
    }
  }

  // 提取座椅图片 (第3张)
  const zuoYiClass = picinfo.callist.find(item => item.name === '座椅');

  if (zuoYiClass && zuoYiClass.list && zuoYiClass.list.length > 0) {
    console.log('座椅图片总数:', zuoYiClass.list.length);

    const zuoYiIndex = 2;

    if (zuoYiIndex < zuoYiClass.list.length) {
      const pic = zuoYiClass.list[zuoYiIndex];

      imageList.push({
        ...carInfo,
        image_url: pic.picpath,
        image_index: 7,
        category: '座椅',
        view_type: 'viewDoor',
        pic_id: pic.picid,
        spec_id: pic.specid
      });

      console.log(`座椅图片 ${zuoYiIndex + 1} [viewDoor]: ${pic.picpath}`);
    }
  }

  if (imageList.length === 0) {
    console.log('未找到任何图片');
    return [{ json: { ...carInfo, error: '未找到图片' } }];
  }

  console.log(`成功提取 ${imageList.length} 张图片`);

  return imageList.map(img => ({ json: img }));

} catch (error) {
  console.log('解析JSON出错:', error.message);
  return [{ json: { ...carInfo, error: 'JSON解析失败: ' + error.message } }];
}

// 合并所有图片为最终结果
const allImages = $input.all();

if (allImages.length === 0) {
  return {
    json: {
      success: false,
      error: '未找到任何图片',
      message: '未能提取到图片信息'
    }
  };
}

const firstImage = allImages[0].json;

// 检查是否有错误
if (firstImage.error) {
  return {
    json: {
      success: false,
      error: firstImage.error,
      carId: firstImage.carId,
      carName: firstImage.carName
    }
  };
}

// 按分类统计
const categorySummary = {};
const images = [];

for (const item of allImages) {
  const img = item.json;
  images.push({
    url: img.image_url,
    category: img.category,
    view_type: img.view_type,
    index: img.image_index,
    pic_id: img.pic_id,
    spec_id: img.spec_id
  });

  if (!categorySummary[img.category]) {
    categorySummary[img.category] = 0;
  }
  categorySummary[img.category]++;
}

console.log('\n=== 图片提取完成 ===');
console.log(`车型: ${firstImage.carName}`);
console.log(`carID: ${firstImage.carId}`);
console.log(`匹配方式: ${firstImage.matchType}`);
console.log(`总图片数: ${images.length}`);
console.log('分类统计:', categorySummary);

return {
  json: {
    success: true,
    carId: firstImage.carId,
    carName: firstImage.carName,
    brandID: firstImage.brandID,
    matchType: firstImage.matchType,
    totalImages: images.length,
    categorySummary: categorySummary,
    images: images,
    message: `成功获取${images.length}张图片`,
    timestamp: new Date().toISOString()
  }
};
